import { useState, useEffect } from 'react';

const Test = () => {
  const [state, setstate] = useState([]);

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setstate(data);
      });
  }, []);
  return (
    <div>
      {state.map((s) => (
        <li key={s.id}>{s.name}</li>
      ))}
    </div>
  );
};

export default Test;
